  false,\n\t\"url\": null,\n\t\"notes\": \"Inventory of mineral properties in Snohomish
  County, Washington. This is II. summary report of the known metallic and nonmetallic
  mineral properties of Snohomish County compiled from information in the files of
  the Division of Geology. This information has been secured in part from field investigations
  and in part from published reports of both State and Federal agencies together with
  notes in technical journals. No attempt has been made to indicate the sources of
  data on individual properties since the objective is to present the essential facts
  in as concise form as possible, in order to bring only the known useful facts to
  the attention of those persons interested in the Snohomish County mineral resources.\",\n\t\"license_title\":
